    data: |
      SELECT ALL + col1 * + 11 FROM tab1 (FORMAT parquet) WHERE NOT - col1 BETWEEN ( - + col2 + col2 + + - CAST ( NULL AS INTEGER ) - + 74 ) AND - col2;
  - name: tab1

outputs:
  - name: q6084.out
    data: |
      154
      517
      55
